import React from 'react'
import './main.css'
// import { useLocation } from 'react-router-dom';
// import { Router } from 'react-router-dom';
import './song.mp3';


export default function Playbar() {

  // const location = useLocation();
  // console.log(location);
  return (
    // <Router>
      <div className='playbar'>

      <audio controls>
          <source src='../../song.mp3' type='mpeg'/>
      </audio>





      <div className='icons-container'>   
      <div className='iconz'>
        <div className='icon-container'><i className="fa-regular fa-heart icons"></i></div>
        <div className='icon-container'><i className="fa-solid fa-music icons"></i></div>
        <div className='icon-container'><i className="fa-solid fa-up-right-and-down-left-from-center"></i></div>
      </div>
      <div className='iconzz'>
        <div className='icon-container'><i className="fa-solid fa-shuffle"></i></div>
        <div className='icon-container'><i className="fa-solid fa-backward"></i></div>
        <div className='icon-containeer'><i className="fa-solid fa-circle-pause"></i></div>
        <div className='icon-container'><i className="fa-solid fa-forward"></i></div>
        <div className='icon-container'><i className="fa-solid fa-repeat"></i></div>
      </div>
      <div className='iconzzz'>
      <div className='icon-container'><i className="fa-solid fa-volume-xmark"></i></div>
      <hr />
      <div className='icon-container'><i className="fa-solid fa-volume-high"></i></div>
      </div>
      </div>
      </div>
    // </Router>

  )
}
